import {deleteedudegree} from '../../../../CommonApps/AllAPICalls';

import iitdlogo from './IITDLogo.png';



const UnitBarInstDegree = (props)=>{




const deleteEduDegreeHandler=()=>{

//let edudegreeid = props.achievementId;


